/**
 * @file
 * Colorbox Style JS.
 */

(function ($) {

Drupal.behaviors.initColorboxDefaultStyle = {
  attach: function (context, settings) {
    $(context).bind('cbox_complete', function () {
      // Only run if there is a title.
      if ($('#cboxTitle:empty', context).length == false) {
        $('#cboxLoadedContent img', context).bind('mouseover', function () {
          $('#cboxTitle', context).slideDown();
        });
        $('#cboxOverlay', context).bind('mouseover', function () {
          $('#cboxTitle', context).slideUp();
        });
      }
      else {
        $('#cboxTitle', context).hide();
      }
    });
  }
};

})(jQuery);
;
(function ($) {
  "use strict";
  /**
   * Enable the colorbox inline functionality.
   */
  Drupal.behaviors.colorboxInline = {
    attach: function (context, drupalSettings) {
      $(once('colorbox-inline-processed', '[data-colorbox-inline]', context)).each(function () {
        var $link = $(this),
          data = $link.data(),
          settings = $.extend({}, drupalSettings.colorbox, {
            href: false,
            inline: true
          }, {
            className: data.class,
            href: data.colorboxInline,
            width: data.width,
            height: data.height,
            rel: data.rel,
            open: false
          });

		// Hide the colorbox source after if it was hidden before use.
        if (!$(settings.href).filter(':visible')[0]) {
          settings.onCleanup = function($link) {
            $($link.cache.href).hide();
          }
        }

        $link.colorbox(settings);
        $link.click(function () {
         $($(this).data('colorboxInline')).show();
         $(this).colorbox();
        });
      });
    }
  };
})(jQuery);
;
/**
 * @file
 * kh_product behaviors.
 */
(function ($, Drupal) {
  "use strict";

  Drupal.behaviors.kh_custom_node_form = {
    attach: function (context, settings) {
      if (context === document) {
        setTimeout(function() {
          $('.shs-container .shs-field-container').each(function(){
            var count = $(this).find(".shs-widget-container").length;
            for (var i=0; i< count; i++){
              var check_val = $(this).find($("[data-shs-level="+i+"] select")).val();
              if (check_val == '_none'){
                $(this).remove();
              }
            }
          });
        }, 5000);
      }
    },
  };
})(jQuery, Drupal);
